INSERT INTO `consents` (`id`, `title`, `content`, `video`, `agree`, `reject`, `created_user_at`, `deleted_user_at`, `updated_user_at`, `created_at`, `deleted_at`, `updated_at`) VALUES
(1, 'Consentimiento Informado', '<p>\n		<strong>\n			•&nbsp;Objetivo del proyecto.\n		</strong>\n	</p>\n	<p>\n		El proyecto tiene como objetivo ampliar la cobertura de diagnóstico, intervención y seguimiento de la salud mental, los trastornos mentales de bases psico-biológicas, la violencia de género, y las problemáticas psicosociales y socioemocionales a través de la implementación de una plataforma tecnológica. \n	</p>\n	<p>\n		<strong>•	¿Quiénes están a cargo de esta investigación?</strong>\n	</p>\n	<p>\n		El proyecto se encuentra a cargo y dirigido por el Grupo de investigación Cognición y Educación de la Universidad del Magdalena.\n	</p>\n	<p>\n		<strong>•	¿Qué se hará?</strong>\n	</p>\n	<p>\n		Si decides participar, encontrarás una serie de preguntas que indagan sobre tu salud mental y otros factores relacionados con tu bienestar psicológico. El tiempo aproximado de duración es de 45 minutos. \n	</p>\n	<p>\n		<strong>•	¿Qué se hará con la información recolectada?</strong>\n	</p>\n	<p>\n		Toda la información proporcionada será tratada con total confidencialidad, por lo que se garantiza el cuidado de la identidad de los participantes. Los datos obtenidos serán utilizados solo con fines investigativos.\n	</p>\n	<p>\n		<strong>•	¿Cuáles son los riesgos? </strong>\n	</p>\n	<p>\n		El presente proyecto no atenta contra la integridad de las personas participantes, debido a que se basa en los lineamientos establecidos en la Resolución 8430 de 1993 del Ministerio de Salud y Protección Social de Colombia, en la cual, se establecen las normas científicas, técnicas y administrativas para la investigación en salud, así como también, la Ley 1090 de 2006 que regula la actividad de los psicólogos y la Ley 1581 de 2012, por la cual se dictan las disposiciones generales para la protección de datos personales. No obstante, es posible que los temas tratados puedan generar algún grado de incomodidad debido a la reflexión que se hace sobre las variables evaluadas, en caso de presentarse alguna reacción ansiosa, se puede agendar una cita en donde los profesionales encargados se comunicaran con usted. \n	</p>\n	<p>\n		<strong>•	Condiciones y derechos</strong>\n	</p>\n	<p>\n		- Su participación es voluntaria. Si decide no participar, no generará ningún tipo de efecto en la relación establecida. <br>\n		- La información personal recogida será de carácter confidencial y se utilizará solo para los objetivos de esta investigación, protegiendo su identidad. Esto implica que los resultados pueden aparecer en una publicación(es) científica(s) o ser divulgados en una reunión(es) científica(s), pero de manera anónima, sin comprometer su privacidad.<br>\n		- La información producto del desarrollo del proyecto solo será manejada por el personal científico y de apoyo asignado. Los resultados solo serán conocidos por estos, manteniéndose en estricta confidencialidad. Además, se informará sobre esto a usted.<br>\n		- Si acepta dar su consentimiento en este estudio, debe dar clic en la opción de “Acepto términos” al final del presente formulario de consentimiento, que implica que ha leído y comprendido el mismo.<br>\n	</p>\n	<p>\n		<strong>•	Confidencialidad</strong>\n	</p>\n	<p>\n		La información que se reciba y se recolecte será de carácter confidencial y utilizada únicamente para los fines descritos anteriormente, asimismo, solo podrá ser revelada si durante la evaluación, el psicólogo detecta de manera clara que hay un evidente daño para la persona, algún miembro de la familia o terceros.\n	</p>\n	<p>\n		<strong>•	¿Cuáles son los beneficios?</strong>\n	</p>\n	<p>\n		- Los resultados de la investigación podrían facilitar el desarrollo y fortalecimiento de programas y proyectos dirigidos a la promoción de la salud mental y la prevención de problemáticas como la violencia intrafamiliar, de género y otras. Esto puede conducir a un mejoramiento del proceso de intervención y abordaje de este tema en esta área, así como su manejo adecuado. <br>\n		- Esta investigación no busca obtener beneficio económico alguno para los investigadores ni para las personas que participan.<br>\n		- El participante puede obtener una retoalimentación inmediata de los resultados de su evaluación, lo cual le permitrira tener un mayor conocimiento sobre aspectos de su salud mental\n		<br>\n	</p>\n	<p>\n		Antes de dar su autorización para participar de este estudio, ustede debe haber resuelto satisfactoriamente todas sus dudas e inquietudes. Si más adelante requiere información adicional, puede obtenerla a través de los siguientes medios: Correo electrónico saludmentalsgr@unimagdalena.edu.co o al número de teléfono: 4381000 ext. 3382.\n	</p>\n	<p>\n		He leído toda la información descrita en este consentimiento antes de aceptar. Se me ha brindado los medios de contacto para responder mis dudas. Por lo tanto, yo identificado (a) como aparece a continuación accedo a participar como sujeto de investigación en este estudio. Asimismo, sé con claridad que tengo el derecho a negarme a participar o descontinuar mi participación en cualquier momento, sin que esta decisión represente algún perjuicio para mi. \n	</p>', NULL, 'Sí, acepto términos', 'No acepto', NULL, NULL, NULL, '2022-03-31 16:24:19', NULL, '2022-03-31 16:24:19');
